import { Home, Settings, MessageSquare,Users,GitMerge } from "react-feather";

const PopoverNodeDetail = (props) => {
  return (
    <div>

      <p>{props.props.node.data.task_title}</p>
      <p>{props.props.node.data.children.length}</p>
      {props.props.node.data.task_desc}
    </div>
